import React, { useState } from 'react';
import HeroCarousel from '../components/HeroCarousel';
import { useLanguage } from '../context/LanguageContext';
import './Contact.css';

const Contact = () => {
  const { t } = useLanguage();
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    alert(t('contact.thankYou'));
    setFormData({ name: '', email: '', subject: '', message: '' });
  };

  return (
    <div className="contact-page">
      <HeroCarousel title={t('contact.title')} subtitle={t('contact.subtitle')} />

      <div className="contact-content">
        <div className="container">
          <div className="contact-main">
            <div className="contact-info">
              <div className="info-section">
                <h3>{t('contact.getInTouch')}</h3>
                <h2>{t('contact.contactInfo')}</h2>
              </div>

              <div className="contact-details">
                <div className="contact-item">
                  <div className="contact-icon">üìç</div>
                  <div className="contact-text">
                    <h4>{t('contact.ourAddress')}</h4>
                    <p>Al badayer desert Hatta Oman Road sharjah</p>
                  </div>
                </div>

                <div className="contact-item">
                  <div className="contact-icon">üìû</div>
                  <div className="contact-text">
                    <h4>{t('contact.phoneNumber')}</h4>
                    <p>+971564455568</p>
                  </div>
                </div>

                <div className="contact-item">
                  <div className="contact-icon">‚úâÔ∏è</div>
                  <div className="contact-text">
                    <h4>{t('contact.emailAddress')}</h4>
                    <p>malinfo00@tourm.com</p>
                    <p>supuurt24@tourm.com</p>
                  </div>
                </div>
              </div>
            </div>

            <div className="contact-form-section">
              <h3>{t('contact.sendUsMessage')}</h3>
              <form onSubmit={handleSubmit} className="contact-form">
                <div className="form-group">
                  <input
                    type="text"
                    name="name"
                    placeholder={t('contact.yourName')}
                    value={formData.name}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group">
                  <input
                    type="email"
                    name="email"
                    placeholder={t('contact.yourEmail')}
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group">
                  <input
                    type="text"
                    name="subject"
                    placeholder={t('contact.subject')}
                    value={formData.subject}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group">
                  <textarea
                    name="message"
                    placeholder={t('contact.yourMessage')}
                    rows="6"
                    value={formData.message}
                    onChange={handleChange}
                    required
                  />
                </div>
                <button type="submit" className="btn btn-primary btn-large">
                  {t('contact.sendMessage')}
                </button>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
